INSERT INTO `stage_list` VALUES (1,'1st','Friday - Saturday','TransPi offer its services to undergraduate college students enrolled in morning studies.'),(2,'2nd','Friday - Sunday','You can’t apply for a university you’re not registered in order to get to your university which is nearby. If we detect that, we’ll DENY your request.'),(3,'3rd','Friday - Tuesday','You can book for your friend to share the same ride by giving him your referral code. Your friend has to be from the same university, same off-days and nearby your home.'),(4,'4th','Friday - Wednesday','Your friend has to confirm the registration through the app within 24 hours of booking. After this time period if your friend HAS NOT confirmed registration. Your registration will be treated individually.'),(5,'5th','Friday - Thursday','After verifying and submitting the booking request. You will be matched with the perfect ride for you. If you cancel your ride after the matching process, you’ll not be able to re-apply for 90 days.'),(6,'','Friday - Monday','');
