can do from the mobile app or web app.&nbsp; You will, however, need to login to the web app to purchase a Quick Course.&nbsp; Once you have purchased it on the webapp it will automatically be available on your mobile app as well.</p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"color:#1f4067\">Making Purchases on the Platform</span></h2>\n\n<p>In order to&nbsp;complete purchases on the platform, you will need to register a free PayPal account and add your credit card details. In the mobile app Settings Menus under &ldquo;Billing&rdquo; you will see &ldquo;Setup PayPal Account&rdquo; where you can register your free PayPal account. If you already have a PayPal account, all you need do is Login to Paypal during the checkout process to complete a purchase.</p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"color:#1f4067\">Awareness Rewards (AR)</span></h2>\n\n<p>In the app you have your own unique invite code, you can use this to invite your friends to Sterkla.&nbsp; When one of your friends registers with your code and has their first paid coaching session or purchases their first Quick Course, you will receive AR50 which you can redeem for coaching or Quick Courses.&nbsp; AR10 = $1.</p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"color:#1f4067\">Member Badges</span></h2>\n\n<p>We have four different badges that you can achieve based on how much coaching you have had, so that coaches know how serious you are about you own growth.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\n	<tbody>\n		<tr>\n			<td><span style=\"color:#1f4067\"><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573470942_upload.png\" style=\"float:left; height:71px; width:71px\" /></strong></span></td>\n			<td>\n			<p><span style=\"color:#1f4067\"><strong>Rookie</strong></span></p>\n\n			<p>Rookies have had less than 10 hours of coaching and are beginning their exciting journey of self-discovery, as they move towards becoming Explorers!</p>\n		