	<td>\n			<p><span style=\"color:#1f4067\"><strong>Bright Spark</strong></span></p>\n\n			<p>Bright Sparks are super smart coaches who are still building their experience on Sterkla and have less than 150 hours of Sterkla coaching experience!</p>\n			</td>\n		</tr>\n		<tr>\n			<td><span style=\"color:#1f4067\"><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471439_upload.png\" style=\"float:left; height:71px; width:71px\" /></strong></span></td>\n			<td>\n			<p><br />\n			<span style=\"color:#1f4067\"><strong>Rising Star</strong></span></p>\n\n			<p>Rising Stars are coaches who are beginning to shine with their growing experience and skills and have between 150 - 400 hours of coaching experience on Sterkla!</p>\n			</td>\n		</tr>\n		<tr>\n			<td><span style=\"color:#1f4067\"><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471458_upload.png\" style=\"float:left; height:70px; width:70px\" /></strong></span></td>\n			<td>\n			<p>&nbsp;</p>\n\n			<p><span style=\"color:#1f4067\"><strong>Shooting Star</strong></span></p>\n\n			<p>Shooting Stars are coaches who are really standing out through their brilliance and amazing experience.&nbsp; They have between 400 - 1000 hours of coaching experience on Sterkla!</p>\n			</td>\n		</tr>\n		<tr>\n			<td><span style=\"color:#1f4067\"><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471475_upload.png\" style=\"float:left; height:70px; width:70px\" /></strong></span></td>\n			<td>\n			<p>&nbsp;</p>\n\n			<p><span style=\"color:#1f4067\"><strong>Super Star</strong></span></p>\n\n			<p>Super Stars are our most experienced coaches and are awakening the world with their coaching superpowers, they have over 1000 hours of coaching experience on Sterkla!</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>Once again, welcome to Sterkla and congratulations on taking the first step on your amazing journey of self-discovery.&nbsp; We are always here to help whenever you need us, simply contact us at <a href=\"mailto:members@sterkla.com\">members@sterkla.com</a> or for general support <a href=\"mailto:support@sterkla.com\">support@sterkla.com</a>.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n'),(4,'terms-condition','<p>Terms Condition</p>\n\n<p>Thanks for signing up, we are so excited to have you join our Sterkla community.&nbsp; We are on a mission&nbsp;to make coaching accessible to&nbsp;every person on the planet, and so&nbsp;help to awaken the world.&nbsp; We believe that our job is to make it as easy as possible for you to connect with the coaches you need, in the areas in which you need support.</p>\n\n<p>&nbsp;</p>\n\n<hr />\n<p>&nbsp;</p>\n\n<p><span style=\"color:#1f4067\"><strong>Here are a few important points to get you started&hellip;</strong></span></p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"color:#1f4067\">Free Coaching</span></h2>\n\n<p>As a new member you automatically qualify for 90 minutes of free coaching.&nbsp; While some coaches have opted out of this offering, you can use your free minutes to book coaching sessions with multiple coaches.&nbsp; This gives you the opportunity to experience the platform and their coaching with no risk.</p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"color:#1f4067\">Video Calling</span></h2>\n\n<p>Once you have booked an appointment with a coach, a video call button will appear just before the session is due to begin.&nbsp; Coaching happens via live video calling, all from within the app or web app.</p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"color:#1f4067\">Cancelling a Coaching Appointment</span></h2>\n\n<p>Once a coach has accepted your appointment request, it is considered &ldquo;Confirmed&rdquo;.&nbsp; Should you wish you cancel a confirmed appointment, you must cancel it more than 12 hours prior to the start time.&nbsp; Cancellations within 12 hours, but more than 4 hours prior to the sessions will carry a 50% cancellation fee.&nbsp; Any appointments cancelled within 4 hours of the sessions will be charged in full.</p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"color:#1f4067\">Accessing the Platform</span></h2>\n\n<p>You can access the Sterkla platform via our mobile app,&nbsp;click here to download it from the&nbsp;<a href=\"http://apps.apple.com/us/app/id1472511908\">Apple App Store</a> or&nbsp;click here to download it from the&nbsp;<a href=\"http://play.google.com/store/apps/details?id=com.sterkla.app\">Google Playstore</a>.&nbsp; We also have a web app, <a href=\"https://app.sterkla.comw\">https://app.sterkla.com</a> &nbsp;where you can access most of the mobile app features, including video calling, as you may find it easier to conduct the coaching via your laptop rather than your mobile phone.</p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"color:#1f4067\">Quick Courses</span></h2>\n\n<p>In the app we have a library of Quick Courses.&nbsp; Quick Courses are online courses that focus on a very specific topic, with a very clear learning objective. You can try 30% of any Quick Course for free, which you can do from the mobile app or web app.&nbsp; You will, however, need to login to the web app to purchase a Quick Course.&nbsp; Once you have purchased it on the webapp it will automatically be available on your mobile app as well.</p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"color:#1f4067\">Making Purchases on the Platform</span></h2>\n\n<p>In order to&nbsp;complete purchases on the platform, you will need to register a free PayPal account and add your credit card details. In the mobile app Settings Menus under &ldquo;Billing&rdquo; you will see &ldquo;Setup PayPal Account&rdquo; where you can register your free PayPal account. If you already have a PayPal account, all you need do is Login to Paypal during the checkout process to complete a purchase.</p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"color:#1f4067\">Awareness Rewards (AR)</span></h2>\n\n<p>In the app you have your own unique invite code, you can use this to invite your friends to Sterkla.&nbsp; When one of your friends registers with your code and has their first paid coaching session or purchases their first Quick Course, you will receive AR50 which you can redeem for coaching or Quick Courses.&nbsp; AR10 = $1.</p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"color:#1f4067\">Member Badges</span></h2>\n\n<p>We have four different badges that you can achieve based on how much coaching you have had, so that coaches know how serious you are about you own growth.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\n	<tbody>\n		<tr>\n			<td><span style=\"color:#1f4067\"><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573470942_upload.png\" style=\"float:left; height:71px; width:71px\" /></strong></span></td>\n			<td>\n			<p><span style=\"color:#1f4067\"><strong>Rookie</strong></span></p>\n\n			<p>Rookies have had less than 10 hours of coaching and are beginning their exciting journey of self-discovery, as they move towards becoming Explorers!</p>\n			</td>\n		</tr>\n		<tr>\n			<td><span style=\"color:#1f4067\"><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573470977_upload.png\" style=\"float:left; height:71px; width:71px\" /></strong></span></td>\n			<td>\n			<p><br />\n			<span style=\"color:#1f4067\"><strong>Explorer</strong></span></p>\n\n			<p>Explorers have had between 10 - 60 hours of coaching and are fast building self-awareness, as they move towards becoming Awakening Explorers!</p>\n			</td>\n		</tr>\n		<tr>\n			<td><span style=\"color:#1f4067\"><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471003_upload.png\" style=\"float:left; height:69px; width:69px\" /></strong></span></td>\n			<td>\n			<p>&nbsp;</p>\n\n			<p><span style=\"color:#1f4067\"><strong>Awakening Explorer</strong></span></p>\n\n			<p>Awakening Explorers have had between 60 - 100 hours of coaching and are beginning to enter self-mastery, as they progress towards becoming Enlightened Masters!</p>\n			</td>\n		</tr>\n		<tr>\n			<td><span style=\"color:#1f4067\"><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471023_upload.png\" style=\"float:left; height:70px; width:70px\" /></strong></span></td>\n			<td>\n			<p>&nbsp;</p>\n\n			<p><span style=\"color:#1f4067\"><strong>Enlightened Master</strong></span></p>\n\n			<p>Enlightened Masters have had more than 100 hours of coaching and are changing the world with their wisdom!</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"color:#1f4067\">Coach Badges</span></h2>\n\n<p>We have four different badges that the coaches can achieve based on their&nbsp;experience on the Sterkla platform.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\n	<tbody>\n		<tr>\n			<td><span style=\"color:#1f4067\"><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471381_upload.png\" style=\"float:left; height:73px; width:73px\" /></strong></span></td>\n			<td>\n			<p><span style=\"color:#1f4067\"><strong>Bright Spark</strong></span></p>\n\n			<p>Bright Sparks are super smart coaches who are still building their experience on Sterkla and have less than 150 hours of Sterkla coaching experience!</p>\n			</td>\n		</tr>\n		<tr>\n			<td><span style=\"color:#1f4067\"><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471439_upload.png\" style=\"float:left; height:71px; width:71px\" /></strong></span></td>\n			<td>\n			<p><br />\n			<span style=\"color:#1f4067\"><strong>Rising Star</strong></span></p>\n\n			<p>Rising Stars are coaches who are beginning to shine with their growing experience and skills and have between 150 - 400 hours of coaching experience on Sterkla!</p>\n			</td>\n		</tr>\n		<tr>\n			<td><span style=\"color:#1f4067\"><strong><img alt=\"\" src=\"https://app.sterkla.com/upload_temp/1573471458_upload.png\" style=\"float:left; height:70px; width:70px\" /></strong></span></td>\n			<td